import{_ as e,o as a,c as t,O as i}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 54.1-533 Registration and renewal fees.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/54.1-533.md","filePath":"vacode/54.1-533.md"}'),r={name:"vacode/54.1-533.md"},o=i('<h1 id="§-54-1-533-registration-and-renewal-fees" tabindex="-1">§ 54.1-533 Registration and renewal fees. <a class="header-anchor" href="#§-54-1-533-registration-and-renewal-fees" aria-label="Permalink to &quot;§ 54.1-533 Registration and renewal fees.&quot;">​</a></h1><p>An application for registration or renewal of registration as an athlete agent shall be accompanied by a nonrefundable fee for each of the following: (i) an initial application for registration, (ii) an application for registration based on a certificate of registration or its equivalent issued by another state, (iii) an application for renewal of registration, and (iv) an application for renewal of registration based on a renewal of registration or its equivalent in another state.</p><p>That fee shall be:</p><ol><li><p>For a one-year registration or renewal, in the amount of $700;</p></li><li><p>For a two-year registration or renewal, in the amount of $1,150; or</p></li><li><p>For the fee set forth in subdivision 1 or 2, or both, of this section, a higher or lower fee that the Director determines by regulation is necessary and consistent with § <a href="/vacode/54.1-113/">54.1-113</a>.</p></li></ol><p>2020, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?201+ful+CHAP0481" target="_blank" rel="noreferrer">481</a>, § 54.1-526.</p>',5),n=[o];function s(l,c,f,p,d,h){return a(),t("div",null,n)}const u=e(r,[["render",s]]);export{g as __pageData,u as default};
